@Knucklebeak1 Here's a couple of things to consider:
1) This isn't new. Hospitalizations have been higher than our cases indicate for several weeks already.
2) Because we aren't testing well, hospitalization may actually precede diagnosis, eliminating lag.

@JordanSonnentag You're right on the lag. But here's a couple of things to consider:
1) This isn't new. Hospitalizations have been higher than our cases indicate for several weeks already.
2) Because we aren't testing well, hospitalization may actually precede diagnosis, eliminating lag.

You guys know I'm skeptical of the "falling" case numbers the governor and even some news outlets are touting. Why? Because we have 500 hospitalizations. 

Let's look at the number of active and new cases we were experiencing the last time our hospitalizations were around 500.
-&gt;

We also don't know how many positive antigen test results we're missing, since the state still isn't reporting them (even as probable or presumptive). 

What we know for sure is there are positives out there right now that aren't being counted.
--&gt;&gt;

