@lifejourneyjeh1 A few things to note about the Recovery classification:

It does not require a person test negative for Covid-19
It does not require contact with the patient to verify that they are symptom-free

@nuerateknik @jblasley @halfdochailey @maddow You're right in that it's different from a PCR test. It's an antigen test, which like a PCR test, diagnoses current infection. It's definitely easy to confuse with an antibody test, which identifies a previous infection. 
Latest research show 80% accuracy.
